    <!-- Estilos principales -->
    <style>
* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

:root {
    --bg-primary: #ffffff;
    --bg-secondary: #f8fafc;
    --bg-sidebar: #ffffff;
    --text-primary: #1e293b;
    --text-secondary: #64748b;
    --border-color: #e2e8f0;
    --accent-color: #2563eb;
    --accent-hover: #2563eb;
    --code-bg: #f1f5f9;
    --sidebar-width: 260px; /* Ancho dinámico del sidebar */
}

.dark {
    --bg-primary: #0f172a;
    --bg-secondary: #1a2332;
    --bg-sidebar: #1e293b;
    --text-primary: #f1f5f9;
    --text-secondary: #94a3b8;
    --border-color: #3b82f6;
    --accent-color: #60a5fa;
    --accent-hover: #3b82f6;
    --code-bg: #334155;
}

body {
    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
    background-color: var(--bg-primary);
    color: var(--text-primary);
    line-height: 1.6;
    transition: all 0.3s ease;
}

/* Layout principal */
.app-container {
    display: grid;
    grid-template-columns: var(--sidebar-width) 1fr var(--toc-width, 240px);
    grid-template-rows: 74px 1fr;
    min-height: 100vh;
    transition: grid-template-columns 0.3s;
}

.app-container.sidebar-collapsed {
    grid-template-columns: 0px 1fr var(--toc-width, 240px);
}

/* Header */
.header {
    grid-column: 1 / 4;
    grid-row: 1 / 2;
    background: var(--bg-sidebar);
    border-bottom: 1px solid var(--border-color);
    padding: 1rem 2rem;
    display: flex;
    justify-content: space-between;
    align-items: center;
    position: sticky;
    top: 0;
    z-index: 50;
}

/* Sidebar */
.sidebar {
    grid-column: 1 / 2;
    grid-row: 2 / 3;
    position: sticky;
    top: 74px;
    height: calc(100vh - 74px);
    overflow-y: auto;
    background: var(--bg-sidebar);
    border-right: 1px solid var(--border-color);
    padding: 0 1rem 2rem 1rem;
    width: var(--sidebar-width);
    min-width: 180px;
    max-width: 400px;
    transition: width 0.3s;
}

/* Main content */
.main-content {
    grid-column: 2 / 3;
    grid-row: 2 / 3;
    padding: 2rem;
    overflow-y: auto;
    max-width: none;
    margin: 0;
    transition: none;
}

/* Table of Contents */
.toc {
    grid-column: 3 / 4;
    grid-row: 2 / 3;
    position: sticky;
    top: 74px;
    height: calc(100vh - 74px);
    overflow-y: auto;
    background: var(--bg-sidebar);
    border-left: 1px solid var(--border-color);
    padding: 0 1rem 2rem 1rem;
}

.logo {
    font-size: 1.5rem;
    font-weight: bold;
    color: var(--accent-color);
}

.header-controls {
    display: flex;
    gap: 1rem;
    align-items: center;
}

/* Botón para cambiar el ancho del sidebar (ejemplo visual) */
.sidebar-width-controls {
    display: flex;
    gap: 0.5rem;
    margin-bottom: 1rem;
}

.search-box {
    padding: 0.5rem;
    border: 1px solid var(--border-color);
    border-radius: 0.5rem;
    background: var(--bg-primary);
    color: var(--text-primary);
    outline: none;
}

.theme-toggle {
    padding: 0.5rem;
    background: none;
    border: 1px solid var(--border-color);
    border-radius: 0.5rem;
    color: var(--text-primary);
    cursor: pointer;
    transition: all 0.2s;
}

.theme-toggle:hover {
    background: var(--bg-secondary);
}

.nav-section {
    margin-bottom: 2rem;
}

.nav-title {
    font-weight: 600;
    color: var(--text-primary);
    margin-bottom: 1rem;
    text-transform: uppercase;
    font-size: 0.875rem;
    letter-spacing: 0.05em;
}

.nav-list {
    list-style: none;
}

.nav-item {
    margin-bottom: 0.5rem;
}

.nav-link {
    display: block;
    padding: 0.5rem 0.75rem;
    color: var(--text-secondary);
    text-decoration: none;
    border-radius: 0.375rem;
    transition: all 0.2s;
    cursor: pointer;
}

.nav-link:hover,
.nav-link.active {
    background: var(--accent-color, #3b82f6);
    color: white;
}


.content-wrapper {
    max-width: none;
    width: 100%;
    margin: 0;
}


.toc-title {
    font-weight: 600;
    margin-bottom: 1rem;
    color: var(--text-primary);
    font-size: 0.875rem;
    text-transform: uppercase;
    letter-spacing: 0.05em;
}

.toc-list {
    list-style: none;
}

.toc-item {
    margin-bottom: 0.25rem;
}

.toc-link {
    display: block;
    padding: 0.25rem 0;
    color: var(--text-secondary);
    text-decoration: none;
    font-size: 0.875rem;
    transition: color 0.2s;
    cursor: pointer;
}

.toc-link:hover {
    color: var(--accent-color);
}

.toc-link.level-2 {
    padding-left: 1rem;
}

.toc-link.level-3 {
    padding-left: 2rem;
}

.toc-link.level-4 {
    padding-left: 3rem;
}

/* Markdown styles */
.markdown-content h1,
.markdown-content h2,
.markdown-content h3,
.markdown-content h4,
.markdown-content h5,
.markdown-content h6 {
    margin-top: 2rem;
    margin-bottom: 1rem;
    font-weight: 600;
    line-height: 1.25;
}

.markdown-content h1 {
    font-size: 2.25rem;
    border-bottom: 2px solid var(--border-color);
    padding-bottom: 0.5rem;
    margin-top: 0;
}

.markdown-content h2 {
    font-size: 1.875rem;
    border-bottom: 1px solid var(--border-color);
    padding-bottom: 0.25rem;
}

.markdown-content h3 {
    font-size: 1.5rem;
}

.markdown-content h4 {
    font-size: 1.25rem;
}

.markdown-content p {
    margin-bottom: 1rem;
}

.markdown-content ul,
.markdown-content ol {
    margin: 0.3rem 0;
    padding-left: 2rem;
}

.markdown-content li {
    margin-bottom: 0.15rem;
}

.markdown-content code {
    background: var(--code-bg);
    padding: 0.125rem 0.25rem;
    border-radius: 0.25rem;
    font-family: 'Courier New', monospace;
    font-size: 0.875rem;
}

.markdown-content pre {
    background: var(--code-bg);
    padding: 1rem;
    border-radius: 0.5rem;
    overflow-x: auto;
    margin: 1rem 0;
}

.markdown-content pre code {
    background: none;
    padding: 0;
}

.markdown-content blockquote {
    border-left: 4px solid var(--accent-color);
    padding-left: 1rem;
    margin: 1rem 0;
    color: var(--text-secondary);
    font-style: italic;
}

.markdown-content table {
    width: 100%;
    border-collapse: collapse;
    margin: 1rem 0;
}

.markdown-content th,
.markdown-content td {
    padding: 0.75rem;
    border: 1px solid var(--border-color);
    text-align: left;
}

.markdown-content th {
    background: var(--bg-secondary);
    font-weight: 600;
}

/* Responsive */

/* Responsive */
@media (max-width: 1024px) {
    .toc {
        display: none;
    }
    .app-container {
        grid-template-columns: 260px 1fr;
    }
}

@media (max-width: 768px) {
    .sidebar {
        display: none;
    }
    .app-container {
        grid-template-columns: 1fr;
    }
    .main-content {
        padding: 1rem;
    }
}


.mobile-menu-toggle {
    display: none;
    background: none;
    border: none;
    color: var(--text-primary);
    font-size: 1.5rem;
    cursor: pointer;
}

@media (max-width: 768px) {
    .mobile-menu-toggle {
        display: block;
    }
}

.markdown-content h0,
.markdown-content h1,
.markdown-content h2,
.markdown-content h3,
.markdown-content h4,
.markdown-content h5,
.markdown-content h6 {
    scroll-margin-top: 80px; /* Ajusta este valor al alto de tu header */
}

.sidebar-btn {
  padding: 0.4rem 1rem;
  border: 1px solid var(--border-color);
  background: var(--bg-secondary);
  color: var(--text-primary);
  border-radius: 0.5rem;
  font-size: 1rem;
  cursor: pointer;
  transition: background 0.2s, color 0.2s, border 0.2s;
  outline: none;
}

.sidebar-btn:hover,
.sidebar-btn:focus {
  background: var(--accent-color);
  color: #fff;
  border-color: var(--accent-color);
}

.sidebar-toggle-btn {
  font-size: 1.2rem;
  padding: 0.4rem 0.8rem;
  margin-left: 0.5rem;
  background: var(--accent-hover);
  color: #fff;
  border-color: var(--accent-hover);
}

.sidebar-toggle-btn:hover,
.sidebar-toggle-btn:focus {
  background: var(--accent-color);
  color: #fff;
  border-color: var(--accent-color);
}

.sidebar-icon-btn {
  padding: 0;
  border-radius: 0.15rem;
  background: var(--bg-secondary);
  border: 1px solid var(--border-color);
  display: flex;
  align-items: center;
  justify-content: center;
  width: 12px;
  height: 12px;
  min-width: 12px;
  min-height: 12px;
  max-width: 14px;
  max-height: 14px;
}

.sidebar-icon-btn svg {
  width: 7px;
  height: 7px;
  display: block;
}

.sidebar-icon-btn:hover,
.sidebar-icon-btn:focus {
  background: var(--accent-color);
  color: #fff;
  border-color: var(--accent-color);
}
</style>
    <script
      defer
      src="https://cdn.jsdelivr.net/npm/alpinejs@3.14.9/dist/cdn.min.js"
    ></script>
    <script src="
https://cdn.jsdelivr.net/npm/marked@15.0.12/lib/marked.umd.min.js
"></script>
    <script src="
https://cdn.jsdelivr.net/npm/mermaid@11.6.0/dist/mermaid.min.js
"></script>
  </head>
  <body>
    <div class="app-container" x-data="docsApp()" :class="{ 'sidebar-collapsed': !sidebarOpen }">
      <!-- Header -->
      <header class="header">
        <div style="display: flex; align-items: center; gap: 1rem">
          <div class="logo">
            <template x-if="logoUrl">
              <img
                :src="logoUrl"
                alt="Efficintix"
                style="
                  height: 2rem;
                  vertical-align: middle;
                  margin-right: 0.5rem;
                "
              />
            </template>
            <span x-text="logo"></span> <span x-text="title"></span>
          </div>
        </div>

        <div class="header-controls" style="position: relative; display: flex; align-items: center; gap: 0.5rem; margin-left: auto;">
          <!-- Eliminados los controles de ancho del sidebar aquí -->
          <input
            type="text"
            placeholder="Buscar..."
            class="search-box"
            x-model="searchQuery"
            @focus="searchModalOpen = true; $nextTick(() => { $refs.searchInput.select(); })"
            x-ref="searchInput"
            readonly
            style="cursor: pointer; background: var(--bg-primary);"
          />
          <div style="display: flex; flex-direction: column; gap: 0.18rem; align-items: flex-end;">
            <!-- Botón para colapsar/mostrar ambos paneles -->
            <button class="sidebar-toggle" @click="toggleAllPanels()" aria-label="Colapsar/Expandir menús" style="font-size: 0.6rem; padding: 0.01rem 0.10rem; border-radius: 0.18rem; border: 1px solid var(--border-color); background: var(--bg-secondary); cursor: pointer; align-self: flex-end;">
              <!-- SVG doble flecha horizontal -->
              <svg width="20" height="16" viewBox="0 0 20 16" fill="none" xmlns="http://www.w3.org/2000/svg" style="vertical-align: middle;"><path d="M7 2L2 8L7 14" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/><path d="M13 2L18 8L13 14" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/></svg>
            </button>
            <button class="theme-toggle" @click="darkMode = !darkMode; document.documentElement.classList.toggle('dark', darkMode); localStorage.setItem('darkMode', darkMode);" :aria-label="darkMode ? 'Modo claro' : 'Modo oscuro'" style="font-size: 0.65rem; padding: 0.01rem 0.10rem; border-radius: 0.18rem; border: 1px solid var(--border-color); background: var(--bg-secondary); cursor: pointer; align-self: flex-end;">
              <span x-show="!darkMode" style="font-size: 0.8em;">🌙</span>
              <span x-show="darkMode" style="font-size: 0.8em;">☀️</span>
            </button>
          </div>
        </div>
        <!-- Modal de búsqueda -->
        <div
          x-show="searchModalOpen"
          x-transition.opacity
          style="
            position: fixed;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            z-index: 1000;
            background: rgba(0, 0, 0, 0.5);
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 20px;
            box-sizing: border-box;
          "
          @click.self="closeSearchModal()"
        >
          <div
            style="
              background: #fff;
              color: #222;
              border-radius: 12px;
              box-shadow: 0 20px 60px rgba(0, 0, 0, 0.3);
              width: 100%;
              max-width: 600px;
              max-height: 80vh;
              display: flex;
              flex-direction: column;
              margin: auto;
              transform: translateY(0);
            "
            @click.stop
          >
            <!-- Header del modal -->
            <div
              style="
                display: flex;
                align-items: center;
                padding: 20px;
                border-bottom: 1px solid #eee;
              "
            >
              <input
                type="text"
                class="search-box"
                x-model="searchQuery"
                @input="searchAllPages()"
                @keydown.escape="closeSearchModal()"
                placeholder="Buscar en la documentación..."
                style="
                  flex: 1;
                  font-size: 16px;
                  border: none;
                  outline: none;
                  background: transparent;
                  padding: 8px 0;
                "
                x-ref="modalSearchInput"
                autofocus
              />
              <button
                @click="closeSearchModal()"
                style="
                  background: var(--bg-secondary);
                  border: none;
                  font-size: 24px;
                  margin-left: 15px;
                  cursor: pointer;
                  color: #888;
                  padding: 5px;
                  border-radius: 4px;
                  transition: background-color 0.2s;
                "
                onmouseover="this.style.backgroundColor='#f0f0f0';"
                onmouseout="this.style.backgroundColor='transparent';"
              >
                ×
              </button>
            </div>
            <!-- Contenido del modal -->
            <div
              style="
                overflow-y: auto;
                padding: 0 20px 20px 20px;
                flex: 1;
                min-height: 200px;
              "
            >
              <!-- Resultados de búsqueda -->
              <template x-if="searchQuery && searchResults.length > 0">
                <template x-for="result in searchResults" :key="result.pageId">
                  <div
                    class="search-result-item"
                    style="
                      padding: 15px 0;
                      cursor: pointer;
                      border-bottom: 1px solid #f0f0f0;
                      transition: background-color 0.2s;
                    "
                    @click="goToSearchResult(result); closeSearchModal();"
                    onmouseover="this.style.backgroundColor='#f8f9fa';"
                    onmouseout="this.style.backgroundColor='transparent';"
                  >
                    <strong
                      x-text="result.title"
                      style="display: block; margin-bottom: 5px"
                    ></strong>
                    <div
                      x-html="result.snippet"
                      style="font-size: 14px; color: #666; line-height: 1.4"
                    ></div>
                  </div>
                </template>
              </template>
              <!-- Sin resultados -->
              <div
                x-show="searchQuery && searchResults.length === 0"
                style="
                  padding: 40px 20px;
                  color: #888;
                  text-align: center;
                  font-size: 16px;
                "
              >
                Sin resultados para "<span x-text="searchQuery"></span>"
              </div>
              <!-- Estado inicial -->
              <div
                x-show="!searchQuery"
                style="
                  padding: 40px 20px;
                  color: #aaa;
                  text-align: center;
                  font-size: 16px;
                "
              >
                Escribe para buscar en toda la documentación
              </div>
            </div>
          </div>
        </div>
      </header>

      <!-- Sidebar -->
      <nav class="sidebar" x-show="sidebarOpen" x-transition>
        <!-- Controles de ancho y colapso dentro del sidebar -->
        <div class="sidebar-width-controls" style="margin-bottom: 0.5rem; margin-top: 0; padding-top: 0; display: flex; gap: 0.25rem; align-items: center;">
          <button
            x-show="sidebarOpen"
            @click="toggleSidebar()"
            :aria-label="'Colapsar menú'"
            class="sidebar-toggle"
            style="font-size: 0.55rem; padding: 0.01rem 0.10rem; border-radius: 0.15rem; border: 1px solid var(--border-color); background: var(--bg-secondary); cursor: pointer; align-self: center;"
          >
            <!-- SVG flecha izquierda -->
            <svg width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><path d="M15 19l-7-7 7-7"/></svg>
          </button>
          <button @click="setSidebarWidth('200px')" class="sidebar-btn sidebar-icon-btn" title="Angosto" style="font-size: 0.7rem; padding: 0.04rem 0.18rem; border-radius: 0.22rem;">
            <!-- Angosto: Arrow bar left -->
            <svg xmlns="http://www.w3.org/2000/svg" width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><path d="M21 12H7"/><path d="M11 16l-4-4 4-4"/><path d="M3 19V5"/></svg>
          </button>
          <button @click="setSidebarWidth('260px')" class="sidebar-btn sidebar-icon-btn" title="Normal" style="font-size: 0.7rem; padding: 0.04rem 0.18rem; border-radius: 0.22rem;">
            <!-- Normal: Arrows maximize -->
            <svg xmlns="http://www.w3.org/2000/svg" width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><path d="M4 8V4h4"/><path d="M8 16v4H4"/><path d="M16 4h4v4"/><path d="M20 16v4h-4"/></svg>
          </button>
          <button @click="setSidebarWidth('320px')" class="sidebar-btn sidebar-icon-btn" title="Ancho" style="font-size: 0.7rem; padding: 0.04rem 0.18rem; border-radius: 0.22rem;">
            <!-- Ancho: Arrow bar to right -->
            <svg xmlns="http://www.w3.org/2000/svg" width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><path d="M3 12h14"/><path d="M13 16l4-4-4-4"/><path d="M21 19V5"/></svg>
          </button>
        </div>
        <template
          x-for="(section, idx) in sidebarSections"
          :key="section.title"
        >
          <div class="nav-section">
            <button
              class="nav-title"
              @click="toggleSection(idx)"
              style="
                width: 100%;
                text-align: left;
                background: none;
                border: none;
                padding: 0;
                margin-bottom: 1rem;
                font-weight: 600;
                cursor: pointer;
              "
            >
              <span x-text="section.title"></span>
              <span
                x-text="collapsedSections[idx] ? '▶' : '▼'"
                style="float: right"
              ></span>
            </button>
            <ul class="nav-list" x-show="!collapsedSections[idx]" x-transition>
              <template x-for="item in section.items" :key="item.link">
                <li class="nav-item">
                  <a
                    class="nav-link"
                    :class="{ 'active': currentPage === item.link }"
                    @click="loadPage(item.link)"
                  >
                    <span x-text="item.label"></span>
                  </a>
                </li>
              </template>
            </ul>
          </div>
        </template>
      </nav>

      <!-- Botón flotante para expandir sidebar SOLO visible cuando está cerrado, fuera del sidebar -->
      <button
        x-show="!sidebarOpen"
        @click="toggleSidebar()"
        aria-label="Mostrar menú"
        class="sidebar-toggle"
        style="position: fixed; top: 80px; left: 8px; z-index: 2000; font-size: 0.7rem; padding: 0.04rem 0.18rem; border-radius: 0.22rem; border: 1px solid var(--border-color); background: var(--bg-secondary); cursor: pointer;"
      >
        <!-- SVG flecha derecha -->

              margin-top: 2rem;
              gap: 1rem;

                  border: 1px solid var(--border-color);
                  border-radius: 0.75rem;
                  cursor: pointer;
                  text-align: left;
                "

              </button>
            </template>
            <template x-if="navigation[currentPage]?.next">
              <button

                  background: var(--bg-secondary);
                  border: 1px solid var(--border-color);
                  border-radius: 0.75rem;
                  cursor: pointer;
                  text-align: right;
                "
              >
                Siguiente →
              </button>
            </template>
          </div>
        </div>
      </main>

      <!-- TOC con secciones anidadas colapsables usando Alpine.js puro -->
      <aside class="toc" x-data="{
  open: true,
  tocWidth: '240px',
  lastWidth: '240px',
  setTocWidth(width) {
    this.tocWidth = width;
    this.lastWidth = width;
    document.documentElement.style.setProperty('--toc-width', width);
  },
  collapseToc() {
    this.open = false;
    document.documentElement.style.setProperty('--toc-width', '0px');
  },
  expandToc() {
    this.open = true;
    document.documentElement.style.setProperty('--toc-width', this.lastWidth);
  },
  init() {
    window.addEventListener('toggle-toc-panel', () => {
      if (this.open) {
        this.collapseToc();
      } else {
        this.expandToc();
      }
    });
  },
  toggle(node) {
    node.collapsed = !node.collapsed;
  },
  scrollToHeading(id) {
    const element = document.getElementById(id);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  }
}"

                            </div>
                            <!-- Puedes seguir anidando más niveles si lo deseas -->
                          </li>
                        </template>
                      </ul>
                    </li>
                  </template>
                </ul>

alización del Bundle de DIOT\n\nPara actualizar la SuiteApp de la DIOT, seguiremos esta ruta:\n\n**Personalización → Suite Bundler → Buscar e Instalar paquetes → Listas**\n\nBuscaremos el bundle **Reporte DIOT ID (500773)** seleccionaremos la opcion **\"Actualizar\"**\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FBoton%20de%20actualizar%20Bundle%20DIOT.png?alt=media&token=69191856-5d5b-40d4-91c9-149c330cfdfe)\n\nAl darle clic, demorara algunos minutos y nos enviará a la siguiente pestaña, donde podremos visualizar la **\"Versión actual\"** y la **\"Nueva versión\"**\n\nLe damos clic en **Actualizar paquete**\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FBoton%20de%20actualizar%20paquete%20Bundle%20DIOT.png?alt=media&token=7e2400be-c6b2-4626-acaa-2f6606c83bfd)\n\nNos enviará a la pantalla principal en espera de su término, tarda aproximadamente **20 minutos** la instalación\n\n\n<img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB9AAAAEWCAYAAAA+WQzqAACAAElEQVR4Xuy9aa9fVZbm6VuF7+R7ryMjortK+Vm61V3VWR0EEEAwxEAwg81sgzFgG8xgPDODbWwzGGPwhMHYzPOQgyrjRbfUpZbyRas/RavUcpa4vddaz9p77X3OuYMxnSTx/KSlvdY+f4NTFfUi4qdnryVLCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhB cion de Factura\n\nPara cada factura de pago a proveedores, debemos tener en cuenta que estos campos siempre deben estar visibles y llenos.\n\n- TAXJSON\n- TIPO DE OPERACIÓN\n\nEn caso de que no estén llenos, se tendrá configurar dependiendo del campo\n\n**TAXJSON**\n\n**Ruta: Personalización → Creación de scripts → Despliegue de Script**\n\nSe tiene que desplegar esta opción **EFX_FE_Tax_Fields** en factura de proveedor\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FDespliegue%20de%20Script%20de%20Tax%20Fields.png?alt=media&token=cf0cb623-4c3c-44ff-ad3c-a290adf9d546)\n\nUna vez localizados los campos, clic en la opcion de **Editar** para poder realizar el despliegue del Script.\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FDespliegue%20de%20Script%20de%20tax%20Fields%202.png?alt=media&token=82b256fe-a346-4799-9cbc-e6018214d5d3)\n\n**TIPO DE OPERACIÓN**\n\nEste campo aparecerá en automático al momento de la Instalación del bundle, se debe asignar una opción dependiendo del asunto del pago.\nCuenta con una lista de 3 opciones:\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FTipos%20de%20operacion%20DIOT.png?alt=media&token=643d8fbd-e72c-469c-9347-c798d3ede856)\n\n<div style=\"display: flex; align-items: center\">\n    <img src=\"https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FPencil.png?alt=media&token=c620d50a-be62-4f19-a7dc-c364e89238ba\" style=\"margin-rigth: 7px\">\n        <p><strong>Nota: Cuando son varios pagos, se deben realizar una carga masiva CSV</strong></p>\n</div>\n\n\n<img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB9AAAAEWCAYAAAA+WQzqAACAAElEQVR4Xuy9aa9fVZbm6VuF7+R7ryMjortK+Vm61V3VWR0EEEAwxEAwg81sgzFgG8xgPDODbWwzGGPwhMHYzPOQgyrjRbfUpZbyRas/RavUcpa4vddaz9p77X3OuYMxnSTx/KSlvdY+f4NTFfUi4qdnryVLCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEII # Configuracion en Códigos de Impuesto\n\nEs sencillo este paso, pero indispensable, porque dependemos de un campo en específico.\n\nLa ruta para llegar a este punto es:\n\n**Configuración → Impuestos → Código de Impuestos**\n\n![alt tex](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FCodigo%20de%20Impuestos.png?alt=media&token=403d977e-0cec-45e9-abc0-96dfe65f1ce7) \n\nDaremos clic en **editar** a cualquier impuesto a usar, encontraremos el campo llamado **DIOT - TIPO DE IMPUESTO**, este se usará y se seleccionará dependiendo el Impuesto usado a nivel línea de la transacción.\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FEdicion%20de%20codigo%20de%20impuestos.png?alt=media&token=ee1c547c-17df-4459-98e2-686875bad195)\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FSeleccion%20de%20Tipo%20de%20Impuesto%20DIOT.png?alt=media&token=9d9b5810-d85e-43bd-b4c5-0f6e417dc5be)\n\n<img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB9AAAAEWCAYAAAA+WQzqAACAAElEQVR4Xuy9aa9fVZbm6VuF7+R7ryMjortK+Vm61V3VWR0EEEAwxEAwg81sgzFgG8xgPDODbWwzGGPwhMHYzPOQgyrjRbfUpZbyRas/RavUcpa4vddaz9p77X3OuYMxnSTx/KSlvdY+f4NTFfUi4qdnryVLCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBC  Creación del Folder Raíz DIOT\n\nEs una Carpeta exclusiva para los reportes, seguiremos la siguiente ruta para crearla:\n\n**Documentos → Archivos → Archivador → Nuevo**\n\nUna vez dentro, nos mandara la siguiente pantalla.\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FCreacion%20de%20Carpeta%20Raiz%20DIOT.png?alt=media&token=4d19b386-f29d-4d4e-8b70-ea523bfdf929)\n\nSolo colocaremos el nombre de **\"Reporte DIOT\"** y daremos guardar.\n\nUna vez creada copiaremos el **ID** de la Carpeta.\n\n<div style=\"display: flex; align-items: center\">\n    <img src=\"https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FCarpeta%20Creada%20Reporte%20DIOT.png?alt=media&token=91325329-b71a-4298-856e-a10ca57f57ed\">\n</div>\n\n<div style=\"display: flex; align-items: center\">\n  <img src=\"https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FPencil.png?alt=media&token=c620d50a-be62-4f19-a7dc-c364e89238ba\" style=\"margin-right: 7px;\">\n    <p><strong>Nota: El ID se encuentra del lado izquierdo de la carpeta </strong></p>\n</div>\n\nEste **ID** nos servira como conexión para que los TXT generados por la DIOT se archiven en el folder creado anteriormente.\n\nPara completar la conexión, vamos a la ruta:\n\n**Personalización → Creación de scripts → Despliegue de Script**\n\nBuscaremos el siguiente Script: **Genera DIOT MR**\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FDespliegue%20Genera%20DIOT%20MR.png?alt=media&token=1545fb68-9461-437e-b1f5-21dee9a451e3)\n\nUna vez seleccionado, damos clic en **Editar**\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FBonton%20de%20editar%20Genera%20DIOT%20MR.png?alt=media&token=379e9713-b58b-487d-9285-0f5f84635259)\n\nEncontraremos la subficha **Parámetros**, y en la opción Folder de Raíz colocaremos el **ID** antes copiado\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FParametros%20Genera%20DIOT%20MR.png?alt=media&token=7208ebe2-83a7-4387-9937-f68048d55079)\n\n\n<img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB9AAAAEWCAYAAAA+WQzqAACAAElEQVR4Xuy9aa9fVZbm6VuF7+R7ryMjortK+Vm61V3VWR0EEEAwxEAwg81sgzFgG8xgPDODbWwzGGPwhMHYzPOQgyrjRbfUpZbyRas/RavUcpa4vddaz9p77X3OuYMxnSTx/KSlvdY+f4NTFfUi4qdnryVLCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQ acion del Bundle DIOT\n\nPara instalar el bundle entraremos a la siguiente ruta:\n\n**Personalización → Suite Bundler → Buscar e Instalar paquetes**\n\nUna vez ingresado colocaremos el ID del Bundle **(500773)** y daremos clic en el botón de buscar.\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FInstalacion%20de%20DIOT%20(ID).png?alt=media&token=d6d69ff0-5d85-40a3-a5f5-52bdc5b743c9)\n\nUna vez realizada la busqueda, asignara el bundle correspondiente a instalar\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FInstalacion%20de%20Reporte%20DIOT.png?alt=media&token=f377ef9d-0d1c-4794-b015-46631379b93f)\n\nUna vez terminada la instalacion, validaremos en la siguiente ruta:\n\n**Personalización → Suite Bundler → Buscar e Instalar paquetes → Listas**\n\nEncontraremos el Bundle llamado **\"Reporte DIOT\"**\n\n![alt text](https://firebasestorage.googleapis.com/v0/b/mx-plus-docs.appspot.com/o/DIOT%2FInstalado%20de%20Reporte.png?alt=media&token=e78121d8-6f98-474a-a76c-7b7e85d5d4c6)\n\n<img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB9AAAAEWCAYAAAA+WQzqAACAAElEQVR4Xuy9aa9fVZbm6VuF7+R7ryMjortK+Vm61V3VWR0EEEAwxEAwg81sgzFgG8xgPDODbWwzGGPwhMHYzPOQgyrjRbfUpZbyRas/RavUcpa4vddaz9p77X3OuYMxnSTx/KSlvdY+f4NTFfUi4qdnryVLCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCG s una **\"Declaración Informativa de Operaciones con Terceros\"**, es una obligación fiscal en México que deben cumplir las personas físicas y morales que están inscritas en el régimen general de ley.\n\n# ¿Para qué sirve la DIOT?\n\nEsta declaración permite al Servicio de Administración Tributaria (SAT) tener un control sobre las operaciones que los contribuyentes realizan con sus proveedores.\n\nTiene como objetivo proporcionar información detallada sobre las operaciones, para combatir la evasión fiscal y asegurar que todos los participantes en la economía formal cumplan con sus obligaciones fiscales.\n\nSe presenta mensualmente, y la fecha límite para su presentación es el día 17 del mes siguiente al que se reportan las operaciones. \nSe deben incluir datos como el nombre del proveedor, su Registro Federal de Contribuyentes (RFC), el monto de las operaciones realizadas, el IVA trasladado y el IVA retenido, entre otros detalles.\n<img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB9AAAAEWCAYAAAA+WQzqAACAAElEQVR4Xuy9aa9fVZbm6VuF7+R7ryMjortK+Vm61V3VWR0EEEAwxEAwg81sgzFgG8xgPDODbWwzGGPwhMHYzPOQgyrjRbfUpZbyRas/RavUcpa4vddaz9p77X3OuYMxnSTx/KSlvdY+f4NTFfUi4qdnryVLCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghh **\"Declaración Informativa de Operaciones con Terceros\"**, es una obligación fiscal en México que deben cumplir las personas físicas y morales que están inscritas en el régimen general de ley.\n\n# ¿Para qué sirve la DIOT?\n\nEsta declaración permite al Servicio de Administración Tributaria (SAT) tener un control sobre las operaciones que los contribuyentes realizan con sus proveedores.\n\nTiene como objetivo proporcionar información detallada sobre las operaciones, para combatir la evasión fiscal y asegurar que todos los participantes en la economía formal cumplan con sus obligaciones fiscales.\n\nSe presenta mensualmente, y la fecha límite para su presentación es el día 17 del mes siguiente al que se reportan las operaciones. \nSe deben incluir datos como el nombre del proveedor, su Registro Federal de Contribuyentes (RFC), el monto de las operaciones realizadas, el IVA trasladado y el IVA retenido, entre otros detalles.\n<img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB9AAAAEWCAYAAAA+WQzqAACAAElEQVR4Xuy9aa9fVZbm6VuF7+R7ryMjortK+Vm61V3VWR0EEEAwxEAwg81sgzFgG8xgPDODbWwzGGPwhMHYzPOQgyrjRbfUpZbyRas/RavUcpa4vddaz9p77X3OuYMxnSTx/KSlvdY+f4NTFfUi4qdnryVLCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCGEEEIIIYQQQgghhBBCCCG     collapsedSections: [],
    init() {
      let hash = window.location.hash.replace(/^#/, '') || 'introduction';
      let [pageId, anchor] = hash.split('#');
      this.loadPage(pageId, null, anchor);
      this.darkMode = localStorage.getItem('darkMode') === 'true';
      this.$watch('darkMode', value => {
        localStorage.setItem('darkMode', value);
      });
      this.collapsedSections = this.sidebarSections.map(s => s.collapsed ?? false);
    },
    closeSearchModal() {
      this.searchModalOpen = false;
      this.searchQuery = '';
      this.searchResults = [];
    },
    loadPage(pageId, highlightTerm = null, anchor = null) {
      this.currentPage = pageId;
      let content = this.pages[pageId] || '# Página no encontrada';
      if (highlightTerm) {
        const regex = new RegExp(`(${highlightTerm})`, 'gi');
        content = content.replace(regex, '<mark>$1</mark>');
      }
      content = content
        .replace(/\^(.*?)\^/g, '<sup>$1</sup>')
        .replace(/~(.*?)~/g, '<sub>$1</sub>');
      this.renderedContent = marked.parse(content);
      this.$nextTick(() => {
        this.generateToc();
        this.addHeadingIds();
        this.renderMermaid();
        if (anchor) {
          setTimeout(() => {
            const el = document.getElementById(anchor);
            if (el) el.scrollIntoView({ behavior: 'smooth' });
          }, 100);
        }
      });
      this.searchResults = [];
      this.searchQuery = '';
    },
    renderMermaid() {
      document.querySelectorAll('.markdown-content pre code.language-mermaid').forEach((block) => {
        const pre = block.parentElement;
        const mermaidCode = block.textContent;
        const mermaidDiv = document.createElement('div');
        mermaidDiv.className = 'mermaid';
        mermaidDiv.textContent = mermaidCode;
        pre.replaceWith(mermaidDiv);
      });
      if (window.mermaid) {
        window.mermaid.init(undefined, document.querySelectorAll('.mermaid'));
      }
    },
    generateToc() {
      const headings = Array.from(document.querySelectorAll('.markdown-content h1, .markdown-content h2, .markdown-content h3, .markdown-content h4, .markdown-content h5, .markdown-content h6'));
      let counter = 1;
      const tocTree = [];
      const parents = [];
      headings.forEach(heading => {
        const level = parseInt(heading.tagName.charAt(1));
        const baseId = this.slugify(heading.textContent);
        const id = `${baseId}-${counter++}`;
        heading.id = id;
        const node = {
          id,
          text: heading.textContent,
          level,
          collapsed: level === 1 ? false : true, // Primer nivel expandido, los demás colapsados
          children: []
        };
        while (parents.length && parents[parents.length - 1].level >= level) {
          parents.pop();
        }
        if (parents.length === 0) {
          tocTree.push(node);
        } else {
          parents[parents.length - 1].children.push(node);
        }
        parents.push(node);
      });
      this.tableOfContents = tocTree;
    },
    addHeadingIds() {
      const headings = document.querySelectorAll('.markdown-content h1, .markdown-content h2, .markdown-content h3, .markdown-content h4, .markdown-content h5, .markdown-content h6');
      headings.forEach(heading => {
        if (!heading.id) {
          heading.id = this.slugify(heading.textContent);
        }
      });
    },
    slugify(text) {
      return text.toLowerCase()
        .replace(/[^\u0000-\u007F\w\s-]/g, '')
        .replace(/[\s_-]+/g, '-')
        .replace(/^-+|-+$/g, '');
    },
    scrollToHeading(id) {
      const element = document.getElementById(id);
      if (element) {
        element.scrollIntoView({ behavior: 'smooth' });
      }
    },
    searchAllPages() {
      const query = this.searchQuery.trim().toLowerCase();
      if (!query) {
        this.searchResults = [];
        return;
      }
      const results = [];
      for (const [pageId, content] of Object.entries(this.pages)) {
        const idx = content.toLowerCase().indexOf(query);
        if (idx !== -1) {
          const snippetStart = Math.max(0, idx - 30);
          const snippetEnd = Math.min(content.length, idx + query.length + 30);
          let snippet = content.substring(snippetStart, snippetEnd);
          snippet = snippet.replace(new RegExp(`(${this.escapeRegExp(query)})`, 'gi'), '<mark>$1</mark>');
          let title = '';
          const match = content.match(/^#\s+(.+)/m);
          if (match) title = match[1];
          else title = pageId;
          results.push({ pageId, title, snippet });
        }
      }
      this.searchResults = results;
    },
    goToSearchResult(result) {
      this.loadPage(result.pageId, this.searchQuery);
    },
    escapeRegExp(string) {
      return string.replace(/[.*+?^${}()|[\]\\]/g, '\\$&');
    },
    filterContent() {},
    toggleSidebar() {
      this.sidebarOpen = !this.sidebarOpen;
    },
    toggleAllPanels() {
      this.sidebarOpen = !this.sidebarOpen;
      window.dispatchEvent(new CustomEvent('toggle-toc-panel'));
      this.tocOpen = !this.tocOpen;
    },
    toggleSection(idx) {
      this.collapsedSections[idx] = !this.collapsedSections[idx];
    },
    setSidebarWidth(width) {
      document.documentElement.style.setProperty('--sidebar-width', width);
    }
  };
}
    </script>
